.ticket-list-container {
  padding: 2rem;
  max-width: 100%;
  background-image: url("https://res.cloudinary.com/dn0br7hj0/image/upload/v1748784842/background/Background2.webp");
  background-repeat: repeat;
  background-position: center;
  background-size: 300px;
  image-rendering: -webkit-optimize-contrast;
  image-rendering: crisp-edges;
  overflow: hidden;
  margin: 0 auto;
  min-height: 100vh;
}

.ticket-list-header {
  margin-bottom: 2rem;
}

.ticket-list-header h1 {
  font-family: "Meholrax", serif;
  font-size: 2.5rem;
  color: #2c2f11;
  margin-bottom: 1.5rem;
  text-align: center;
}

.ticket-list-controls {
  display: flex;
  justify-content: space-between;
  align-items: center;
  gap: 1rem;
  margin-bottom: 2rem;
}

.search-box {
  position: relative;
  flex: 1;
  max-width: 400px;
}

.search-box input {
  width: 100%;
  padding: 1rem 1rem 1rem 3rem;
  border: 2px solid #2c2f11;
  border-radius: 8px;
  font-size: 1rem;
  background-color: #fff;
  color: #2c2f11;
  transition: all 0.3s ease;
}

.search-box input:focus {
  outline: none;
  box-shadow: 0 0 0 3px rgba(44, 47, 17, 0.1);
}

.search-icon {
  position: absolute;
  left: 1rem;
  top: 50%;
  transform: translateY(-50%);
  color: #2c2f11;
}

.sort-button {
  display: flex;
  align-items: center;
  gap: 0.5rem;
  padding: 1rem 1.5rem;
  background: #2c2f11;
  color: white;
  border: none;
  border-radius: 8px;
  cursor: pointer;
  font-size: 1rem;
  transition: all 0.3s ease;
}

.sort-button:hover {
  opacity: 0.9;
  transform: translateY(-2px);
}

.tickets-grid {
  display: grid;
  grid-template-columns: repeat(auto-fill, minmax(300px, 1fr));
  gap: 2rem;
}

.ticket-card {
  overflow: hidden;
  transition: all 0.3s ease;
}

.ticket-card:hover {
  transform: translateY(-5px);
  box-shadow: 0 8px 25px rgba(0, 0, 0, 0.15);
}

.ticket-image {
  width: 100%;
  overflow: hidden;
}

.ticket-image img {
  width: 100%;
  height: 100%;
  object-fit: contain;
  transition: transform 0.3s ease;
}

.ticket-card:hover .ticket-image img {
  transform: scale(1.05);
}

.ticket-content {
  padding: 1.5rem;
}

.ticket-content h3 {
  font-family: "Meholrax", serif;
  font-size: 1.5rem;
  color: #2c2f11;
  margin-bottom: 1rem;
}

.description {
  color: #666;
  margin-bottom: 1.5rem;
  line-height: 1.5;
  display: -webkit-box;
  -webkit-line-clamp: 3;
  -webkit-box-orient: vertical;
  overflow: hidden;
}

.ticket-footer {
  display: flex;
  justify-content: space-between;
  align-items: flex-end;
}

.price-info {
  flex: 1;
}

.price {
  font-size: 1.2rem;
  font-weight: bold;
  color: #2c2f11;
  margin-bottom: 0.3rem;
}

.child-price {
  font-size: 0.9rem;
  color: #666;
}

.book-button {
  padding: 0.8rem 1.5rem;
  background: #2c2f11;
  color: white;
  border: none;
  border-radius: 6px;
  cursor: pointer;
  font-weight: 500;
  transition: all 0.3s ease;
}

.book-button:hover {
  opacity: 0.9;
  transform: translateY(-2px);
}

@media (max-width: 768px) {
  .ticket-list-controls {
    flex-direction: column;
  }

  .search-box {
    max-width: 100%;
  }

  .sort-button {
    width: 100%;
    justify-content: center;
  }

  .tickets-grid {
    grid-template-columns: 1fr;
  }
}
